import React from "react";
import ReactDOM from "react-dom/client";
import {
  RouterProvider,
  createBrowserRouter,
  createRoutesFromElements,
  Route,
  Link,
} from "react-router-dom";
import About from "./pages/Register";
import Account from "./pages/Accunt";
import Appartamento from "./pages/Appartamento";
import Bacheca from "./pages/Bacheca";
import Calendario from "./pages/Calendario";
import Login from "./pages/Login";
import Spese from "./pages/Spese";
import ToDo from "./pages/Todo";
import Turni from "./pages/Turni";

/**
 * Challenge:
 * Bootstrap the VanLife project by creating the first 2 routes:
 * Home and About.
 *
 * Also include the navbar that can link between the two routes.
 * For now, you'll either need to copy/paste the navbar code
 * to both Home and About pages, or you'll need to find a place
 * to put it where it can be shared between the two pages.
 * (Don't overthink this part - just do whatever is easiest for
 * you because we'll learn a better approach very soon)
 *
 * Review challenge: do all the CSS yourself based on the design
 * linked in the slides.
 */
const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={<Layout />}>
      <Route index element={<Appartamenti />} />
      <Route path="register" element={<Register />} />
      <Route path="login" element={<Login />} />
      <Route path="appartamento/:id" element={<Appartamento />}>
        <Route index element={<Bacheca />} />
        <Route path="Bacheca" element={<Bacheca />} />
        <Route path="Turni" element={<Turni />} />
        <Route path="Spese" element={<Spese />} />
        <Route path="Calendario" element={<Calendario />} />
        <Route path="ToDo" element={<ToDo />} />
        <Route path="Account" element={<Account />} />
      </Route>
      <Route path="*" element={<NotFound />} />
    </Route>
  )
);

function App() {
  return <RouterProvider router={router} />;
}

ReactDOM.createRoot(document.getElementById("root")).render(<App />);
